import React,{Component} from 'react';
import '../../style/home.scss'
import {connect} from 'react-redux';

import { library } from '@fortawesome/fontawesome-svg-core'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faBars,faSearch } from '@fortawesome/free-solid-svg-icons'

library.add(faBars,faSearch)

class Header extends Component {
    render(){
        return (
            <div className="header">
                <div className="nav-icon" onClick="showNav"> <FontAwesomeIcon icon="bars" /></div>
                <div className="header-title"><h3>中票在线<span>北京</span></h3></div>
                <div className="search-icon"><FontAwesomeIcon icon="search" /></div>
            </div>
        )
    }
}


let mapDispatchToProps = dispatch=>{
    return {
        // 把changeshownavStatus方法映射到props
        // this.props.changeshownavStatus(false)
        changeshownavStatus(status){
            dispatch(shownav(status));
        }
    }
  }
  Header = connect(mapDispatchToProps)(Header);


export default Header
